import React from 'react';
import JobItem from './Components/JobItem';

const JobList = ({ jobs, onClick }) => {
  return (
    <div className="job-list">
      {jobs.map(job => (
        <JobItem key={job.id} job={job} onClick={onClick} />
      ))}
    </div>
  );
};

export default JobList;
